                <div class="rightHalf">

                </div>

                <div class="leftHalf">

                </div>

                <div class="welcome">
                    <h1>Welcome to Moji!</h1>
                    <p>Moji is a social networking site where people can share thoughts and ideas.</p>
                    <p><br></br><br></br><br></br>-------------------------------------------</p>
                    <p>Created by<br></br>Jongu Yu<br></br>Juha Jeon</p>
                </div>


            </React.Fragment>
        );
    }


}

export default Home;
